import React from "react";
import Sidebar from "../components/sidebar";
import { Container, Row, Col } from "react-bootstrap";
import TableComponent from "../components/TableComponent"; // Import the TableComponent

const Dailyintakes = () => {
  // Sample data array, replace this with your actual data
  const data = [
    { column1: "Data 1A", column2: "Data 1B" },
    { column1: "Data 2A", column2: "Data 2B" },
    { column1: "Data 3A", column2: "Data 3B" },
    // Add more data objects as needed
  ];

  return (
    <Container fluid>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <Row>
            {/* Your other content here */}
          </Row>
          <div>
            {/* Your other content here */}
            {/* Render the TableComponent and pass the data array */}
            <TableComponent data={data} />
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Dailyintakes;
